    //     setLoggedIn(false);
    //     navigate("/login")
    // }
    function getCookie(n) {
        let a = `; ${document.cookie}`.match(`;\\s*${n}=([^;]+)`);
        console.log( a ? a[1] : '');
    }

  return (
    <div>
    <Button 
      variant="outline-primary"
      className="mb-3" 
      type="button"
      onClick={(e) => {e.preventDefault(); getCookie("access")}}>
        Log Out
    </Button>
    </div>
  )
}

export default LogoutButton
